import React, { Component } from 'react'
import styled from 'styled-components'

const TextSectionWrapper = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  height: 95vh;
`

class TextSection extends Component {
  render () {
    return (
      <TextSectionWrapper>
        <p>

        </p>
      </TextSectionWrapper>
    )
  }
}

export default TextSection
